import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const getEmployeeList = (employees) => {
  const employeeList = employees.data.map(employee =>
    <li className="employee-item">
      <ul className="employee-name">
        {employee.name}
      </ul>
      <ul className="employee-bio">
        <p>{employee.bio}</p>
      </ul>
    </li>
  )
  return employeeList
}

function App() {
  const [employees, setEmployees] = useState({ })
  useEffect(() => {
    axios.get('http://localhost:5000/employees').then(response => {
      setEmployees(response)
    }).catch(error => {
      console.log(error)
    })
  }, [])
  return (
    <div id="employee-list-wrapper">
      {employees.status === 200 ?
        <div>
          <h2 id="employeeheading">Employees</h2>
          <div>{getEmployeeList(employees)}</div>
        </div>
        :
        <h3>LOADING</h3>
      }
    </div>
  );
}

export default App;
